import React from 'react'
import img from '../img/Logo.png'

const Logo = () => {

  const backgroundStyle = {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'end',
    width: '100vw',
    height:'80px',
    backgroundColor:'#3e448b'
  }

  const logoStyle = {
    position:'relative',
    width:'200px', 
    height:'80px',
    right: '20px'
  }


  return (
    <div style={backgroundStyle}>
        <img src={img} style={logoStyle}/>
    </div>
  )
}

export default Logo
